import React, { Component } from 'react'

export class ListaTiposComponentes extends Component{
    render(){
        return (
            <ul>
                <li>Chicotes</li>
                <li>Bases</li>
                <li>Fixture</li>
                <li>Gravadores</li>
            </ul>
        )
    }
}
